=head1 DESCRIPTION

Used for CAPTCHA and challenge token settings. Determines how long a
C<CAPTCHA> or challenge timestamp remains valid after WAF updates it
for a successful C<CAPTCHA> or challenge response.

=head1 ATTRIBUTES


=head2 B<REQUIRED> ImmunityTime => Int

The amount of time, in seconds, that a C<CAPTCHA> or challenge
timestamp is considered valid by WAF. The default setting is 300.

For the Challenge action, the minimum setting is 300.



